import React from 'react';
import { Grid, Paper, Typography } from '@mui/material';
import { PieChart, Pie, Cell, ResponsiveContainer, Legend, Tooltip } from 'recharts';

const Dashboard = () => {
  // Sample data for donut charts
  const firewallData = [
    { name: 'CPU Usage', value: 65 },
    { name: 'Free CPU', value: 35 },
  ];

  const switchData = [
    { name: 'Port Usage', value: 75 },
    { name: 'Free Ports', value: 25 },
  ];

  const serverData = [
    { name: 'Memory Usage', value: 60 },
    { name: 'Free Memory', value: 40 },
  ];

  const COLORS = ['#0088FE', '#ECEFF1'];

  const renderDonutChart = (data, title) => (
    <Paper sx={{ p: 2, height: '100%' }}>
      <Typography variant="h6" gutterBottom align="center">
        {title}
      </Typography>
      <ResponsiveContainer width="100%" height={250}>
        <PieChart>
          <Pie
            data={data}
            cx="50%"
            cy="50%"
            innerRadius={60}
            outerRadius={80}
            fill="#8884d8"
            paddingAngle={5}
            dataKey="value"
          >
            {data.map((entry, index) => (
              <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
            ))}
          </Pie>
          <Tooltip />
          <Legend />
        </PieChart>
      </ResponsiveContainer>
    </Paper>
  );

  return (
    <Grid container spacing={3}>
      <Grid item xs={12}>
        <Typography variant="h4" gutterBottom>System Overview</Typography>
      </Grid>
      
      <Grid item xs={12} md={4}>
        {renderDonutChart(firewallData, 'Firewall CPU Usage')}
      </Grid>

      <Grid item xs={12} md={4}>
        {renderDonutChart(switchData, 'Switch Port Utilization')}
      </Grid>

      <Grid item xs={12} md={4}>
        {renderDonutChart(serverData, 'Server Memory Usage')}
      </Grid>

      <Grid item xs={12}>
        <Paper sx={{ p: 2 }}>
          <Typography variant="h6" gutterBottom>Device Status</Typography>
          <Grid container spacing={2}>
            <Grid item xs={12} md={4}>
              <Typography>Firewall Status: Active</Typography>
              <Typography>Active Connections: 1,234</Typography>
            </Grid>
            <Grid item xs={12} md={4}>
              <Typography>Switch Status: Active</Typography>
              <Typography>Error Rate: 0.01%</Typography>
            </Grid>
            <Grid item xs={12} md={4}>
              <Typography>Server Status: Active</Typography>
              <Typography>Uptime: 15 days</Typography>
            </Grid>
          </Grid>
        </Paper>
      </Grid>
    </Grid>
  );
};

export default Dashboard;
